import '../form/projectForm'
import ProjectForm from '../form/projectForm'

const ProjectDirectory = () => {
  return(
    <div className="project-container">
      <ProjectForm/>
      <ProjectForm/>
      <ProjectForm/>
      <ProjectForm/>
    </div>
  )
}

export default ProjectDirectory
